import React, {Component}  from 'react';
import Cell from '../images/1.png ';

class Board extends Component {

  render(){
      return(
        <div className='board'>
           {/* <Cell/> */}
            <div className='row'>
               <img src={Cell} alt="missed" className='cell'></img>
            </div>

        </div>
    );
  }
}

export default Board;
